import { createBrowserRouter, RouterProvider } from "react-router-dom";

import Home from "./pages/Home";
const router = createBrowserRouter([{ path: "/", element: <Home /> }]);
function App() {
  return (
    <RouterProvider>
      <h1>App</h1>
      <Home />
    </RouterProvider>
  );
}

export default App;
